script: |
  super -f text -I q10414.spq | sort > q10414.out

inputs:
  - name: q10414.spq
    data: |
      SELECT col2 * col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE 5 BETWEEN NULL AND + col0 / + - col2 / - col0 + col0 + - + col2 + + ( col0 ) / col0 * + col2;
  - name: tab1

outputs:
  - name: q10414.out
    data: |
